import React from 'react';
import Button from "react-bootstrap/Button";
import Nav from "react-bootstrap/Nav";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons'
import { faBoxOpen } from '@fortawesome/free-solid-svg-icons'
import { faCoins } from '@fortawesome/free-solid-svg-icons'

export default class Navbar extends React.Component{
    render() {
        return (
            <Nav variant="dark" className="navbar">
                
                <Nav.Item class="nav-item">
                    <Nav.Link class ="nav-link" href="#"><FontAwesomeIcon icon={faBoxOpen}/> Open Packs</Nav.Link>
                </Nav.Item>
                <Nav.Item class="nav-item">
                    <Nav.Link class ="nav-link" href="#"><FontAwesomeIcon icon={faCoins}/> Shop</Nav.Link>
                </Nav.Item>
                <Nav.Item class="nav-item">
                    <Nav.Link class ="nav-link" href="#"><FontAwesomeIcon icon={faSignOutAlt}/> Sign Out</Nav.Link>
                </Nav.Item>
            </Nav>
            
        );
    }
}
